//         DD  DISP=SHR,DSN=&DFHLOAD..SDFHMAC
//SYSLIN   DD  DISP=(MOD,PASS),DSN=&&LOADSET,UNIT=VIO,
//             SPACE=(800,(&WSPC,&WSPC))
//SYSPRINT DD  SYSOUT=&SOUT,DCB=BLKSIZE=13300
//SYSUDUMP DD  SYSOUT=&SOUT,DCB=BLKSIZE=13300
